import logo from './logo.svg';
import './App.css';

function App() {

  let videoId = null;
  console.log("sent");
  fetch("./getRandomVideo").then(function(data){
    console.log(data);
    console.log("received");
    return data.json();
  }).then(function(obj){
    console.log("2nd then");
    console.log(obj);
    videoId = obj.data;

  });

  if (videoId == null){
    return (
      <div className="App">
        hello

      </div>
    );
  }
  else{
    return (
      {$videoId}
    );
  }

}

export default App;
